#!/bin/bash

cd "$(dirname "$0")/supabase"
node -e "const { fetchPendingTasks } = require('./fetch-pending-tasks'); fetchPendingTasks().then(tasks => console.log(tasks)).catch(err => console.error(err));"

/**
 * Fetch Pending Tasks from Supabase
 * Queries tasks with status = 'pending', ordered by priority
 */

const { getSupabaseClient } = require('./supabase-client');

/**
 * Fetch all pending tasks from Supabase
 * @returns {Promise<Array>} Array of pending tasks, sorted by priority (descending)
 * @throws {Error} If Supabase query fails
 */
async function fetchPendingTasks() {
  const supabase = getSupabaseClient();

  try {
    const { data, error } = await supabase
      .from('tasks')
      .select('*')
      .eq('status', 'pending')
      .order('priority', { ascending: false })
      .order('created_at', { ascending: true });

    if (error) {
      throw new Error(`Failed to fetch pending tasks: ${error.message}`);
    }

    return data || [];
  } catch (err) {
    console.error('Error fetching pending tasks:', err);
    throw err;
  }
}

/**
 * Format pending tasks for Supervisor notification
 * @param {Array} tasks Raw task objects from Supabase
 * @returns {Array} Formatted task objects with essential fields
 */
function formatTasksForSupervisor(tasks) {
  return tasks.map(task => ({
    id: task.id,
    title: task.title,
    description: task.description,
    priority: task.priority,
    metadata: task.metadata,
    created_at: task.created_at
  }));
}

/**
 * Get task count and priority distribution
 * @param {Array} tasks Array of pending tasks
 * @returns {Object} Statistics about pending tasks
 */
function getTaskStats(tasks) {
  if (tasks.length === 0) {
    return { total: 0, byPriority: {} };
  }

  const byPriority = {};
  tasks.forEach(task => {
    const p = task.priority || 0;
    byPriority[p] = (byPriority[p] || 0) + 1;
  });

  return {
    total: tasks.length,
    byPriority,
    highestPriority: Math.max(...tasks.map(t => t.priority || 0))
  };
}

module.exports = {
  fetchPendingTasks,
  formatTasksForSupervisor,
  getTaskStats
};

/**
 * Notify Supervisor Agent
 * Send pending tasks to Supervisor for assignment and execution
 */

const fs = require('fs');
const path = require('path');

// Path to supervisor's pending queue
const SUPERVISOR_QUEUE_PATH = '/home/abhishek-sharma/.openclaw/agents/supervisour/sessions/pending_queue.jsonl';

/**
 * Notify supervisor of pending tasks
 * Writes a message to the supervisor's queue file in JSONL format
 * @param {Array} tasks Array of formatted pending tasks
 * @returns {Promise<Object>} Result object with status and details
 */
async function notifySupervisor(tasks) {
  if (!tasks || tasks.length === 0) {
    return {
      success: true,
      message: 'No tasks to notify. Supervisor sleeping.',
      tasksNotified: 0,
      timestamp: new Date().toISOString()
    };
  }

  try {
    // Ensure directory exists
    const dir = path.dirname(SUPERVISOR_QUEUE_PATH);
    if (!fs.existsSync(dir)) {
      fs.mkdirSync(dir, { recursive: true });
    }

    // Create notification message
    const notification = {
      type: 'tasks_available',
      timestamp: new Date().toISOString(),
      task_count: tasks.length,
      tasks: tasks,
      from_agent: 'dispatcher'
    };

    // Append to queue in JSONL format (one JSON object per line)
    const jsonLine = JSON.stringify(notification) + '\n';
    fs.appendFileSync(SUPERVISOR_QUEUE_PATH, jsonLine);

    return {
      success: true,
      message: `Notified supervisor of ${tasks.length} pending task(s)`,
      tasksNotified: tasks.length,
      timestamp: new Date().toISOString(),
      queuePath: SUPERVISOR_QUEUE_PATH
    };
  } catch (err) {
    console.error('Error notifying supervisor:', err);
    return {
      success: false,
      message: `Failed to notify supervisor: ${err.message}`,
      tasksNotified: 0,
      timestamp: new Date().toISOString(),
      error: err
    };
  }
}

/**
 * Check if supervisor queue exists and is accessible
 * @returns {Promise<boolean>} true if queue is accessible
 */
async function checkSupervisorQueue() {
  try{
    const dir = path.dirname(SUPERVISOR_QUEUE_PATH);
    return fs.existsSync(dir);
  } catch (err) {
    console.error('Error checking supervisor queue:', err);
    return false;
  }
}

module.exports = {
  notifySupervisor,
  checkSupervisorQueue,
  SUPERVISOR_QUEUE_PATH
};

